                <img id="dragon-head" src="./dragon-full.png" />
                <h1 id="title-txt">PROJECT RYU</h1>
                <img id="tail-bg" src="./dragon-tail-2.png" />
            </div>
        <section>
            <Weather /> 
        </section>
    </div>
    )
}
export default App;
